Create DATABASE duan2
GO
USE [duan2]
GO
SET DATEFORMAT ymd
SET ARITHABORT, ANSI_PADDING, ANSI_WARNINGS, CONCAT_NULL_YIELDS_NULL, QUOTED_IDENTIFIER, ANSI_NULLS, NOCOUNT ON
SET NUMERIC_ROUNDABORT, IMPLICIT_TRANSACTIONS, XACT_ABORT OFF
GO

CREATE TABLE duan2.dbo.appUser (
  username NCHAR(20) NOT NULL
 ,password VARCHAR(100) NOT NULL
 ,name NVARCHAR(50) NOT NULL
 ,avatar VARCHAR(255) NOT NULL
 ,email VARCHAR(50) NOT NULL
 ,phone VARCHAR(15) NOT NULL
 ,isEnable BIT NOT NULL CONSTRAINT DF_appUser_isEnable DEFAULT (0)
 ,created_at DATE NOT NULL CONSTRAINT DF_appUser_created_at DEFAULT (GETDATE())
 ,address_id INT NULL
 ,CONSTRAINT PK_AppUser PRIMARY KEY CLUSTERED (username)
 ,CONSTRAINT UN_appUser UNIQUE (email, phone)
) ON [PRIMARY]
GO
CREATE TABLE duan2.dbo.authorizes (
  id INT IDENTITY
 ,username NCHAR(20) NOT NULL
 ,authority VARCHAR(50) NOT NULL
 ,CONSTRAINT PK_authorizes PRIMARY KEY CLUSTERED (id, username)
) ON [PRIMARY]
GO

ALTER TABLE duan2.dbo.authorizes
ADD CONSTRAINT FK_authorizes_appUser FOREIGN KEY (username) REFERENCES dbo.appUser (username) ON DELETE CASCADE ON UPDATE CASCADE
GO
CREATE TABLE duan2.dbo.verificationToken (
  id INT IDENTITY
 ,username NCHAR(20) NOT NULL
 ,token VARCHAR(100) NOT NULL
 ,expiryDate DATETIME NOT NULL
 ,CONSTRAINT PK_verificationToken PRIMARY KEY CLUSTERED (id)
 ,CONSTRAINT UC_verificationToken UNIQUE (token)
) ON [PRIMARY]
GO

ALTER TABLE duan2.dbo.verificationToken
ADD CONSTRAINT FK_verificationToken_appUser FOREIGN KEY (username) REFERENCES dbo.appUser (username) ON DELETE CASCADE ON UPDATE CASCADE
GO
CREATE TABLE duan2.dbo.sysdiagrams (
  name SYSNAME NOT NULL
 ,principal_id INT NOT NULL
 ,diagram_id INT IDENTITY
 ,version INT NULL
 ,definition VARBINARY(MAX) NULL
 ,PRIMARY KEY CLUSTERED (diagram_id)
 ,CONSTRAINT UK_principal_name UNIQUE (principal_id, name)
) ON [PRIMARY] TEXTIMAGE_ON [PRIMARY]
GO

CREATE TABLE duan2.dbo.province (
